const initialState = {
    cart:{
            id:1,
            User:{
                id: 1,
                userId: 'ian'
            },
            Product:[{
                id: 1,
                title: "Fjallraven - Foldsack No. 1 Backpack, Fits 15 Laptops",
                price: 109.95,
            }]
       
    }
}

const reducer = (state = initialState, action) => {
    switch(action.type){
        default:
            return state;
    }
};

export default reducer;
